function T = Jac_F_roll(r, p, h, dr, dp, dh, xLiDAR, yLiDAR, zLiDAR, a, b, c, ayINS, azINS)
    T = c*(yLiDAR*(cos(p)*cos(r)*(cos(dh)*cos(dr) - sin(dh)*sin(dp)*sin(dr)) - cos(dp)*cos(p)*sin(dr)*sin(r)) - zLiDAR*(cos(p)*cos(r)*(cos(dh)*sin(dr) + cos(dr)*sin(dh)*sin(dp)) + cos(dp)*cos(dr)*cos(p)*sin(r)) + xLiDAR*(cos(p)*sin(dp)*sin(r) - cos(dp)*cos(p)*cos(r)*sin(dh)) + ayINS*cos(p)*cos(r) - azINS*cos(p)*sin(r)) - a*(ayINS*(sin(h)*sin(r) - cos(h)*cos(r)*sin(p)) + azINS*(cos(r)*sin(h) + cos(h)*sin(p)*sin(r)) - xLiDAR*(sin(dp)*(cos(r)*sin(h) + cos(h)*sin(p)*sin(r)) + cos(dp)*sin(dh)*(sin(h)*sin(r) - cos(h)*cos(r)*sin(p))) - zLiDAR*((cos(dh)*sin(dr) + cos(dr)*sin(dh)*sin(dp))*(sin(h)*sin(r) - cos(h)*cos(r)*sin(p)) - cos(dp)*cos(dr)*(cos(r)*sin(h) + cos(h)*sin(p)*sin(r))) + yLiDAR*((cos(dh)*cos(dr) - sin(dh)*sin(dp)*sin(dr))*(sin(h)*sin(r) - cos(h)*cos(r)*sin(p)) + cos(dp)*sin(dr)*(cos(r)*sin(h) + cos(h)*sin(p)*sin(r)))) - b*(ayINS*(cos(h)*sin(r) + cos(r)*sin(h)*sin(p)) + azINS*(cos(h)*cos(r) - sin(h)*sin(p)*sin(r)) - xLiDAR*(sin(dp)*(cos(h)*cos(r) - sin(h)*sin(p)*sin(r)) + cos(dp)*sin(dh)*(cos(h)*sin(r) + cos(r)*sin(h)*sin(p))) - zLiDAR*((cos(dh)*sin(dr) + cos(dr)*sin(dh)*sin(dp))*(cos(h)*sin(r) + cos(r)*sin(h)*sin(p)) - cos(dp)*cos(dr)*(cos(h)*cos(r) - sin(h)*sin(p)*sin(r))) + yLiDAR*((cos(dh)*cos(dr) - sin(dh)*sin(dp)*sin(dr))*(cos(h)*sin(r) + cos(r)*sin(h)*sin(p)) + cos(dp)*sin(dr)*(cos(h)*cos(r) - sin(h)*sin(p)*sin(r))));
end